pragma solidity >=0.5.0 <0.9.0;

contract bakery{
    address public owner=payable(0x78731D3Ca6b7E34aC0F824c42a7cC18A495cabaB);
    address payable salesMan=payable (0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2);
    string meal;


    constructor ()
    {
        owner=msg.sender;
    }

    function getBalance() public view returns(uint)
    {
        return address(this).balance;
    } 

    function sendSales() public payable
    {
        require(msg.sender==owner);
        require(msg.value >= 3 ether);
        salesMan.transfer(getBalance());
    }

}

